export default function getListStudents(id, firstName, location) {
    this.id = id;
    this.firstName = firstName;
    this.location = location;

    let arr = [];
    arr[0] = new getListStudents(1, "Guillaume", "San Francisco");
    arr[1] = new getListStudents(2, "James", "Columbia");
    arr[2] = new getListStudents(5, "Serena", "San Francisco");
    return arr;
};

